import React from "react"
import NavTab from "./NavTab"
import MovieSearch from "./MovieSearch"
import PageThree from "./PageThree"
import TelevisionSearch from "./TelevisionSearch"
import { BrowserRouter as Router, Route } from "react-router-dom"
import "./App.css"

function App() {
  return (
    <Router>
      <div>
        <div style={{ display: "flex", justifyContent: "center" }}>
          <NavTab />
        </div>
        <div style={{ justifyContent: "center" }}>
          <Route path="/movie" render={() => <MovieSearch />} />
          <Route path="/tv" render={() => <TelevisionSearch />} />
          <Route path="/three" render={() => <PageThree />} />
        </div>
      </div>
    </Router>
  )
}

export default App

/*
Write a function that takes in two arrays, and it 
returns an array of all of the elements that are in both arrays
*/

function divisibleByThree(array) {
  let divisibleNumbers = []
  for (let i = 0; i < array.length; i++) {
    let currentValue = array[i]
    if (currentValue % 3 === 0) {
      divisibleNumbers.push(currentValue)
    }
  }
  return divisibleNumbers
}

console.log(divisibleByThree([1, 21, 8, 30]))

function findCommonNumbers(arrayOne, arrayTwo) {
  let newSet = new Set()
  for (let i = 0; i < arrayOne.length; i++) {
    for (let j = 0; j < arrayTwo.length; j++) {
      let currentValueI = arrayOne[i]
      let currentValueJ = arrayTwo[j]
      if (currentValueI === currentValueJ) {
        newSet.add(currentValueI)
      }
    }
  }
  return Array.from(newSet)
}

console.log(findCommonNumbers([1, 2, 3], [2, 4, 6]))

function multiplyArray(array, number) {
  let multipliedArray = []
  for (let i = 0; i < array.length; i++) {
    let currentValue = array[i]
    let multiplier = currentValue * number
    multipliedArray.push(multiplier)
  }
  return multipliedArray
}

console.log(multiplyArray([1, 2, 3, 4, 5], 2))

function returnMultiplied(arrayOne, arrayTwo) {
  let finalArray = []
  for (let i = 0; i < arrayOne.length; i++) {
    for (let j = 0; j < arrayTwo.length; j++) {
      console.log(i, j)
      let currentValueI = arrayOne[i]
      console.log("Current Value I " + currentValueI)
      let currentValueJ = arrayTwo[j]
      console.log("Current value J " + currentValueJ)
      let multiplied = currentValueI * currentValueJ
      finalArray.push(multiplied)
    }
  }
  return finalArray
}

console.log(returnMultiplied([1, 2, 3], [4, 5, 6]))
